import React, { useState, useEffect } from "react";

const apiUrl = "https://openlibrary.org/authors/OL23919A/works.json";

// console.log(data);

const App = () => {
  const [books, getBooks] = useState();

  const serachBooks = async () => {
    const res = await fetch(apiUrl);
    const data = await res.json();

    getBooks(data.entries);
    console.log(data.entries[0].title);
  };

  useEffect(() => {
    serachBooks();
  }, []);
  //   return <h1>{data.entries[0].title}</h1>;
};

export default App;
